import React from 'react'

const TodoFilters = (props) => {
  return (
    <div>
        <div>
        <img src="" alt="" />
        Все: {props.tasks.length}
      </div>
      <div>
        <img src="" alt="" />
        Активные: {props.filteredActive.length}
      </div>

      <div>
        <img src="" alt="" />
        Завершенные: {props.filteredCompeleted.length}
      </div>
    </div>
  )
}

export default TodoFilters
